    private final static char[][] miniIn = new char[][]{{'L','.','L','L','.','L','L','.','L','L'}, {'L','L','L','L','L','L','L','.','L','L'}, {'L','.','L','.','L','.','.','L','.','.'}, {'L','L','L','L','.','L','L','.','L','L'}, {'L','.','L','L','.','L','L','.','L','L'}, {'L','.','L','L','L','L','L','.','L','L'}, {'.','.','L','.','L','.','.','.','.','.'}, {'L','L','L','L','L','L','L','L','L','L'}, {'L','.','L','L','L','L','L','L','.','L'}, {'L','.','L','L','L','L','L','.','L','L'}};
    public static char[][] oneIter(char[][] in) {
        char[][] out = Arrays.stream(in).map(char[]::clone).toArray(char[][]::new);

        for (int i = 0; i < in.length; i++) {
            for (int y = 0; y < in[i].length; y++) {
                if (in[i][y] == '.') continue;

                int emptyNeighbours = 0;

                if (i - 1 < 0 || y - 1 < 0 || in[i - 1][y - 1] == 'L')
                    emptyNeighbours++;
                if (i - 1 < 0 || in[i - 1][y] == 'L')
                    emptyNeighbours++;
                if (i - 1 < 0 || y + 1 > in[i - 1].length-1 || in[i - 1][y + 1] == 'L')
                    emptyNeighbours++;

                if (y - 1 < 0 || in[i][y - 1] == 'L')
                    emptyNeighbours++;
                if (y + 1 > in[i].length-1 || in[i][y + 1] == 'L')
                    emptyNeighbours++;

                if (i + 1 > in.length-1 || y - 1 < 0 || in[i + 1][y - 1] == 'L')
                    emptyNeighbours++;
                if (i + 1 > in.length-1 || in[i + 1][y] == 'L')
                    emptyNeighbours++;
                if (i + 1 > in.length-1 || y + 1 > in[i + 1].length-1 || in[i + 1][y + 1] == 'L')
                    emptyNeighbours++;

                if (emptyNeighbours == 8 && in[i][y] == 'L') out[i][y] = '#';
                else if (emptyNeighbours < 3 && in[i][y] == '#') out[i][y] = 'L';
            }
        }
        return out;
    }

    public static void main(String[] args) {
        char[][] in = Arrays.stream(miniIn).map(char[]::clone).toArray(char[][]::new);
        char[][] out;

        while (true) {
            boolean areDifferent = false;
            System.out.println("new iter");
            out = oneIter(in);
            for (int i = 0; i < out.length; i++) {
                for (int j = 0; j < out[0].length; j++) {
                    if (in[i][j] != out[i][j]) {
                        areDifferent = true;
                        break;
                    }
                }
            }
            if (!areDifferent) break;
            in = Arrays.stream(out).map(char[]::clone).toArray(char[][]::new);
        }
        System.out.println(Arrays.deepToString(out));
        System.out.println("Pt1: " + Stream.of(out)
                .map(String::valueOf)
                .flatMap(a -> a.chars().mapToObj(c -> (char) c)) // Stream<Character>
                .filter(x -> x != '#')
                .count());
    }
